import { useNavigate } from "react-router-dom";

const btnstyle = {
  all: "unset",
  paddingBottom: "3vh",
  fontSize: "calc(1.5vh + 1vw)",
  display: "flex",
  marginLeft: "10vw",
  color: "#808080",
};

