  const navigate = useNavigate();

  const logout = () => {
    // Î°úÏª¨Ïä§Ìä∏Î¶¨ÏßÄÏóêÏÑú ÌÜ†ÌÅ∞ ÏÇ≠Ï†ú
    const data = JSON.parse(localStorage.getItem("data"));
    localStorage.removeItem("data");
    alert("ÏÑ±Í≥µÏ†ÅÏúºÎ°ú Î°úÍ∑∏ÏïÑÏõÉ ÎêòÏóàÏäµÎãàÎã§.");
    navigate("/");
  };

  const deleteaccount = () => {
    const data = JSON.parse(localStorage.getItem("data"));
    const datatoken = data.token.access;

    fetch(
      "https://port-0-cloudtype-32updzt2alpmcc05e.sel4.cloudtype.app/api/account/delete/",
      {
        method: "DELETE",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${datatoken} `,
        },

        mode: "cors",
      }
    )
      .then((response) => {
        console.log(response);
        //ÏöîÏ≤≠Ïù¥ ÏÑ±Í≥µÏ†ÅÏúºÎ°ú Ïù¥Î£®Ïñ¥Ï°åÎã§Î©¥,
        if (response.ok) {
          localStorage.removeItem("data");
          alert("Í≥ÑÏ†ïÏù¥ ÏÑ±Í≥µÏ†ÅÏúºÎ°ú ÏÇ≠Ï†úÎêòÏóàÏäµÎãàÎã§.");
          navigate("/");
        } else {
          throw new Error("Í≥ÑÏ†ïÏùÑ ÏÇ≠Ï†úÌïòÎäîÎç∞ Ïã§Ìå®ÌñàÏäµÎãàÎã§.");
        }
      })
      .catch((error) => {
        console.error(error);
        alert("Í≥ÑÏ†ïÏùÑ ÏÇ≠Ï†úÌïòÎäîÎç∞ Ïã§Ìå®");
      });
  };

  return (
    <div className={styles.main}>
      <TopNav
        className={styles.topNav}
        text="Í∞úÏù∏/Î≥¥Ïïà"
        link1={undefined}
        link2="/setting"
        icon1={no_icon}
        icon2={no_icon}
      />
      <br />
      <br />
      <br />
      <br />
      <br />
      <button onClick={logout} style={btnstyle}>
        ü´• &nbsp;&nbsp;Î°úÍ∑∏ÏïÑÏõÉ
      </button>
      <br />
      <br />
      <button onClick={deleteaccount} style={btnstyle}>
        ‚õî &nbsp;&nbsp;ÌÉàÌá¥ÌïòÍ∏∞
      </button>
      <MainNav />
    </div>
  );
}

export default SecurityPage;
